import React from "react";
import googleWritingSvg from "../images/google-writing-svg.svg";

export const StaticElementComponent = ({children, isImageLoaded}) => {
    return (
        







      <div>
        {!isImageLoaded ? (
          <div id='google-container'>
                      <div className="empty-blue-snake-loader">
                        <div className="blue-snake-loader"></div>
                      </div>
                      <img src={googleWritingSvg} alt="Google Writing" id="google-writing"/>
                      {children}
                  </div>
        ) : (
          <div className='empty-blue-snake-loader-placeholder'></div>
        )}
      </div>
    );
  };
